  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:06.211150\",\n\t\"name\": \"herbicide-concentrations-in-waters-of-northwestern-ohio\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"New and relatively inexpensive enzyme linked
  immunosorbent assay (ELISA) kits in the 96 well plate format were used to determine
  triazines and alachlor concentrations in waters of northwestern Ohio. Alachlor and
  related herbicides reached peak concentrations in June, the highest being 36.5 ug/1
  in Muddy Creek. The alachlor concentrations probably result in part from detection
  of other herbicides as well as alachlor by the ELISA test, such as metolachlor.
  Triazines also peaked in June but with the highest concentration being only 4.7
  ug/l, also in Muddy Creek. Herbicide concentrations measured in this study are probably
  below actual maximums experienced during and shortly after storms. Herbicide concentrations
  in waters of Ottawa National Wildlife Refuge were generally lower than other area
  waters and probably don't represent a significant hazard to biota, or at most a
  temporary hazard. Refuge managers should be aware that heavy rains previous (within
  about 10 days) to pumping water into refuge units will have increased the amount
  of herbicides in the water being pumped.\",\n\t\"license_title\": \"License Not
